var $=function(i){return document.querySelector(i)};function id(i){return document.getElementById(i)}function listener(i,n,e){id(i)?id(i).addEventListener(n,e):console.log("Element does not exist in the HTML: "+i)}function show(i){id(i).style.display="block"}function hide(i){id(i).style.display="none"}function showParent(i){id(i).parentNode.style.display="block"}function hideParent(i){id(i).parentNode.style.display="none"}function showAlert(i,n,e,o=null){id(i+"-dialog-title").innerHTML=n,id(i+"-dialog-message").innerHTML=e,id(i+"-dialog").style.display="block",listener(i+"-dialog-ok","click",o?function(n){hide(i+"-dialog"),o()}:function(n){hide(i+"-dialog")})}
/**
 * Confirm Dialog
 */function showConfirm(i,n,e){id("confirm-dialog-title").innerHTML=i,id("confirm-dialog-message").innerHTML=n,id("confirm-dialog").style.display="block",listener("confirm-dialog-yes","click",function(i){hide("confirm-dialog"),e()}),listener("confirm-dialog-no","click",function(i){hide("confirm-dialog")})}function editable(i,n){n?(id(i).removeAttribute("readonly"),id(i).classList.value="w3-input w3-block w3-pale-yellow"):(id(i).setAttribute("readonly","readonly"),id(i).classList.value="w3-input w3-block w3-light-grey")}function wp_ajax(i,n,e,o){var t="";for(var l in e)t+="&"+l+"="+e[l];fetch(i,{method:"post",headers:{"Content-type":"application/x-www-form-urlencoded; charset=UTF-8"},body:"action="+n+t}).then(i=>i.json()).then(function(i){o(i)}).catch(function(i){throw i})}